import React from 'react';
import emojis from '../emojis';

function Emojinote(props){
    return(
        <div>
            <p>{props.emoji}</p>
            <dl>
                <dt>{props.name}</dt>
                <dd>{props.description}</dd>
            </dl>
        </div>
    );
}

export default Emojinote;
